    <div className="mx-w-[1240px] mx-auto my-10 border border-[#1a2e05] grid grid-cols-2">
      <div className="border border-[#1a2e05] col-span-1 w-[80%]">
        <img src={laptop} alt="" />
      </div>
          <div className="border border-[#1a2e05] col-span-1">
              <h1>CONNECT WITH ME</h1>
      </div>
    </div>
  );
}
